import React from "react";

export function Model(data, title) {
  return (
    <div className="model">
      {data.map((title, nb_place, index) => {
        return (
          <div>
            <h2 className="model__name">{title}</h2>
            <h3 key={index} className="model__place">
              {nb_place} places
            </h3>
          </div>
        );
      })}
    </div>
  );
}
